import React from "react";
import { Container } from "@mui/material";

const DashboardContainer: React.FC = () => {
  return (
    <Container maxWidth="sm">
      <div>Hi Marcus</div>
      <Button
          variant="contained"
          color="primary"
          fullWidth
          onClick={() => createUser({ name, email, password })}
        >
          Sign up
        </Button>
    </Container>
  );
};

export default DashboardContainer;
